<span class="line">best_model_name <span class="token operator">=</span> <span class="token builtin">min</span><span class="token punctuation">(</span>results<span class="token punctuation">,</span> key<span class="token operator">=</span><span class="token keyword">lambda</span> x<span class="token punctuation">:</span> results<span class="token punctuation">[</span>x<span class="token punctuation">]</span><span class="token punctuation">[</span><span class="token string">&#39;mean_rmse&#39;</span><span class="token punctuation">]</span><span class="token punctuation">)</span></span>
